import React, { useState  , useEffect} from "react";
import classes from "./styles/Projects.module.css";
import './styles/cards.css';
import Target_icon from '../assets/target_icon.png';
const Wheel = ({card}) => {
  const[state , setState] = useState(false);
  console.log(state)
  console.log(card)
  const dummy = card;

    useEffect(()=>{
      setInterval((()=>{
        const temp = dummy[0];
        dummy.shift();
        dummy.push(temp);
        setState((prevstate) => !prevstate)
      }),2000);

    },[dummy])

  return (
    <>
    <div className={classes.wheels} id="project"></div>
    <a href="/" className={classes.btn}>Projects</a>
     { dummy[0] &&<> <div className={classes.cards} id="card1">
     {dummy[0].project_logo ? <img src={ `http://localhost/${dummy[0].project_logo}` } className={classes.ProjectImage}  alt={dummy[0].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[0].name.charAt(0) }</p>
     }

        {/* <p id="c_title1">{dummy[0].name}</p>  */}
        {console.log(dummy[0])}
      </div>
      <div className={classes.cards} id="card2" >
      <img src={Target_icon} alt="active card" id="target_icon"></img>
      {dummy[1].project_logo ? <img src={ `http://localhost/${dummy[1].project_logo}` } className={classes.ProjectImage}  alt={dummy[1].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[1].name.charAt(0) }</p>
     }
      </div>
      <div className={classes.cards} id="card3">

      {dummy[2].project_logo ? <img src={ `http://localhost/${dummy[2].project_logo}` } className={classes.ProjectImage}  alt={dummy[2].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[2].name.charAt(0) }</p>
     }
      </div>
      <div className={classes.cards} id="card4">
      {dummy[3].project_logo ? <img src={ `http://localhost/${dummy[3].project_logo}` } className={classes.ProjectImage}  alt={dummy[3].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[3].name.charAt(0) }</p>
     }
      </div></>}


    </>
  );
};

export default Wheel;
